        const returnedArray = [];
        const individualsMap = new Map(
            arg.map(object => {
              return [object.firstName, object.id];
            }),
         );
         for (const id of individualsMap.values()) {
            returnedArray.push(id)
         }
         return returnedArray;
    } else {
        return [];
    }
}

